import React from 'react';
import './App.css';
import backgroundImage from './assets/background.jpg';
import overlayImage from './assets/robot.png';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';

import Home from "./components/Home";
import About from "./components/Login";
import Blogs from "./components/Projects";


function App() {
  return (
    <div className="App">
      <header>
        <h1>Welcome to HopeKCC</h1>
      </header>
      <nav>
          <Link to="/">Home</Link>
          <Link to="/about">About</Link>
          <Link to="/services">Services</Link>
          <Link to="/contact">Contact</Link>
        </nav>
      <main style={{ backgroundImage: `url(${backgroundImage})` }}>
      <Switch>
            <Route path="/" exact component={Home} />
            <Route path="/about" component={About} />
            <Route path="/services" component={Services} />
            <Route path="/contact" component={Contact} />
          </Switch>
      <img src={overlayImage} alt="Overlay" className="overlay-image" />

      </main>
      <footer>
        <p>&copy; 2024 HopeKCC</p>
      </footer>
    </div>
  );
}

export default App;
